import { Box, Typography } from "@mui/material";
import "./Item.css";
import React from "react";

const Item = ({ product }) => {
  console.log(product);
  return (
    <Box sx={{ display: "flex", flexDirection: "column" }}>
      <img
        src={
          product.type === "Brand" ? product.brand_image_url : product.image_url
        }
        style={{ width: "21.5vw", height: "15vw", borderRadius: "16px" }}
      />
      <Box sx={{ display: "flex", justifyContent: "space-between" }}>
        <Typography className="type_all">
          {product.type === "Brand"
            ? product.brand_name
            : product.type === "Category"
            ? "#" + product.title
            : product.title}
        </Typography>
        <Typography
          className={
            product.type === "Product" ? "type_all type_Product " : "type_all"
          }
        >
          {product.type === "Brand"
            ? "관심고객수"
            : product.type === "Product"
            ? product.discountPercentage + "%"
            : ""}
        </Typography>
      </Box>
      <Box sx={{ display: "flex", justifyContent: "space-between" }}>
        <Typography>기획전 설명</Typography>
        <Typography>가격 or 고객수</Typography>
      </Box>
    </Box>
  );
};

export default Item;
